 gloom lately, it&#039;s nice to hear some promising local news. Trade mark applications are up - to pre GFC levels in fact. Last financial year saw trade mark applications from Australian businesses in a record 69,003 classes.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1364136825,1),('field:node:101','a:2:{s:12:\"og_group_ref\";a:0:{}s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:174:\"\n					(Published 24 Aug 2011)   The Advisory Council on Intellectual Property (ACIP) is now inviting submissions on the innovation patent system from interested parties.\n				\";s:7:\"summary\";N;s:6:\"format\";s:10:\"plain_text\";s:10:\"safe_value\";s:171:\"<p>(Published 24 Aug 2011)   The Advisory Council on Intellectual Property (ACIP) is now inviting submissions on the innovation patent system from interested parties.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1364136825,1),('field:node:102','a:2:{s:12:\"og_group_ref\";a:0:{}s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:147:\"\n					(Published 18 Aug 2011)   Edward Evans wins the grand final of the ABC New Inventors program for 2011 with his invention The Swing Gate.\n				\";s:7:\"summary\";N;s:6:\"format\";s:10:\"plain_text\";s:10:\"safe_value\";s:144:\"<p>(Published 18 Aug 2011)   Edward Evans wins the grand final of the ABC New Inventors program for 2011 with his invention The Swing Gate.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1364136825,1),('field:node:103','a:2:{s:12:\"og_group_ref\";a:0:{}s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:148:\"\n					(Published 4 Aug 2011)   IP Australia is introducing a new look for Plant Breeder\'s Rights Examination Reports commencing 15 August 2011.\n				\";s:7:\"summary\";N;s:6:\"format\";s:10:\"plain_text\";s:10:\"safe_value\";s:150:\"<p>(Published 4 Aug 2011)   IP Australia is introducing a new look for Plant Breeder&#039;s Rights Examination Reports commencing 15 August 2011.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1364136