INSERT INTO `tbfield_data_body` VALUES ('node','group',0,1,1,'und',0,'Manual Intellectual Property law group.','','filtered_html'),('node','manual_intellectual_property',0,2,2,'und',0,'\n					(Published 13 Feb 2013)   For decades medical scientists have been trying to understand exactly how insulin works with cells. Insulin\'s structure was discovered in 1969, but how it binds to cells has remained a mystery till now. The process has been likened to a secret handshake which signals for the cells to take sugar from the blood.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,3,3,'und',0,'\n					(Published 2 Jan 2013)   Australia\'s intellectual property (IP) system has had its biggest overhaul in twenty years. The Intellectual Property Laws Amendment (Raising the Bar) Act comes into full effect on 15 April 2013. With changes to patents, trade marks, copyright, designs and plant breeder\'s rights, how will the reforms impact you. Here\'s a short checklist of the big ticket items.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,4,4,'und',0,'\n					(Published 6 Dec 2012)   Australia\'s oldest medical research institute has much to celebrate. The Walter and Eliza Hall Institute is currently involved in more than 60 clinical trials worldwide and has more than 300 projects in the pipeline for tech transfer. The institute files a new patent every few weeks.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,5,5,'und',0,'\n					(Published 5 Nov 2012)   If you want to trade overseas or sell to foreign customers via the internet you should consider seeking trade mark protection in the countries you plan to trade. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,6,6,'und',0,'\n					(Published 28 Sep 2012)   We are committed to involving you in our public consultations. These public consultations are targeted to anyone who is interested as well as experts, peak bodies and interest groups. \n\nWe currently have three main consultations open for comment.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,7,7,'und',0,'\n					(Published 17 Sep 2012)   Of all the intellectual property (IP) rights, it\'s patents that usually grab the headlines and it\'s not hard to see why. A patent is a right granted for any device, substance, method or process which is new, inventive and useful.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,8,8,'und',0,'\n					(Published 17 Aug 2012)   On the 17th August 1945 Indonesia proclaimed it\'s independence.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,9,9,'und',0,'\n					(Published 8 Aug 2012)   A mini biotech boom in Australia fueled by patents.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,10,10,'und',0,'\n					(Published 20 Jul 2012)   Most of us have been attracted to the convenience of a piece of furniture—say a table—that comes flat-packed for self assembly. At some point, usually hours later, we find ourselves staring at indecipherable instructions, holding mysterious leftover pieces and with an end result that looks very different to the picture on the label.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,11,11,'und',0,'\n					(Published 28 Jun 2012)   Ever had anything stolen? Did your car disappear when you ducked into the shops or did you come home from a nice evening out only to find your possessions rifled through, damaged and missing? No doubt you called the police and your insurer, filled in lots of forms and haven’t felt as secure since.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,12,12,'und',0,'\n					(Published 23 May 2012)   The word ‘patent’ comes from the Latin patere, meaning ‘to open’. Its original use was in the term ‘letters patent’ meaning a public reading that authorised an action or exclusive right to a person, usually by royal decree.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,13,13,'und',0,'\n					(Published 24 Apr 2012)   Then believe it or not, you like plant breeder’s rights (PBR).\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,14,14,'und',0,'\n					(Published 17 Feb 2012)   “But I don’t want anyone else to use it!” \n\nAsk any of IP Australia’s trade mark examiners and they will tell you that one of the most common reasons they hear from applicants trying to register their trade mark is that they simply don’t want anyone else to use it.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,15,15,'und',0,'\n					(Published 10 Jan 2012)   Plant Breeder’s Rights (PBR). Never heard of them? They don’t exactly pop up in conversation but don’t let the lack of attention fool you into thinking they’re unimportant.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,16,16,'und',0,'\n					(Published 22 Dec 2011)   Intellectual property (IP) is quietly transforming the world we live in, and major sporting events are no exception. In fact, the Rolex Sydney to Hobart Yacht Race is bursting with different forms of IP like patents, designs and trade marks. The entrants list alone is a roll call of brands like Bacardi, Deloitte, Dodo, Ella Bache, and Hugo Boss.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,17,17,'und',0,'\n					(Published 1 Dec 2011)   If you\'re like most people, you probably associate \'design\' with fashion, and you wouldn\'t be wrong. Consider Louis Vuitton\'s iconic monogram pattern or Mambo\'s cartoon branding - they are distinctive and recognisable the world round and when you see them you know instantly who the companies behind them are.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,18,18,'und',0,'\n					(Published 8 Sep 2011)   Whether you\'re starting a new business, buying an established one or considering expansion options like franchising, it\'s easy to neglect your trade mark in your preparations.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,19,19,'und',0,'\n					(Published 21 Mar 2013)   Plant breeder’s rights rarely make the headlines, but this story grows on you. Canberra has reached the ripe old age of 100 and organisers have gone out on a limb with an official commemorative plant variety. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,20,20,'und',0,'\n					(Published 6 Mar 2013)   A Memorandum of Understanding between the Australian and Chinese Intellectual Property Offices will forge a closer relationship between the two offices on patent matters.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,21,21,'und',0,'\n					(Published 27 Feb 2013)   We are coming into the final stages of the Intellectual Property Legislation Amendment (Raising the Bar) Regulation 2013 implementing the Intellectual Property Laws Amendment (Raising the Bar) Act 2012.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,22,22,'und',0,'\n					(Published 25 Feb 2013)   Singapore recently concluded negotiations with the European Union (EU) on a free trade agreement (the EU-Singapore FTA; or EUSFTA). \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,23,23,'und',0,'\n					(Published 22 Feb 2013)   April 15, 2013 is fast approaching and there are many changes as a result of the Intellectual Property Laws Amendment (Raising the Bar) Act that will affect the way you do business with us. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,24,24,'und',0,'\n					(Published 15 Feb 2013)   The \"Tegernsee Group\" of patent offices is conducting a survey on international harmonisation of patent law. As a stakeholder, the Group wants to hear from you.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,25,25,'und',0,'\n					(Published 11 Feb 2013)   We are counting down to 15 April 2013 when the Intellectual Property Laws Amendment (Raising the Bar) Act comes in to full effect. This is a comprehensive change process. Our commitment is to keep you up-to-date with the changes that will affect the way you do business with us.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,26,26,'und',0,'\n					(Published 8 Feb 2013)   Four new appointments announced by Industry and Innovation Minister Greg Combet will provide further rigour and strategic advice to the Australian Government’s decisions on intellectual property (IP).\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,27,27,'und',0,'\n					(Published 8 Feb 2013)   The Pharmaceutical Patents Review Panel is holding public hearings in Canberra, Sydney and Melbourne between 11-15 February 2013.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,28,28,'und',0,'\n					(Published 30 Jan 2013)   Have you recently been affected by a natural disaster? IP Australia extends our support to you.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,29,29,'und',0,'\n					(Published 18 Jan 2013)   Updates on Single Economic Market Patent Outcomes - Single Application Process & Single Examiner Model\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,30,30,'und',0,'\n					(Published 18 Jan 2013)   An extensive consultation process to strengthen innovation and improve the effectiveness of Australia’s intellectual property (IP) system is nearing completion.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,31,31,'und',0,'\n					(Published 3 Jan 2013)   \nThe Phillipines acceded to the Madrid Protocol on 25 July 2012 as advised in WIPO Information Notice No 9/2012.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,32,32,'und',0,'\n					(Published 11 Dec 2012)   IP Australia\'s Customer Service Centre will be closed from 5pm AEST on Monday, 24 December 2012.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,33,33,'und',0,'\n					(Published 6 Dec 2012)   We have been working on a project to make our website fully adaptive for mobile devices.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,34,34,'und',0,'\n					(Published 20 Nov 2012)   The Pharmaceutical Patents Review Panel has released an issues paper, inviting the public to make submissions by 21 January 2013.  The Review Panel will submit a final report to Government in April 2013.  \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,35,35,'und',0,'\n					(Published 14 Nov 2012)   A new study into the economics of gene patents will address a critical information gap and assist the Australian Government with its development of an evidence-based policy.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,36,36,'und',0,'\n					(Published 13 Nov 2012)   Let Wallace & Gromit welcome you to a world of quirky inventions with their popular exhibition opening at the Powerhouse Museum in Sydney on 15 December 2012. \n\nSponsored by IP Australia and showcasing innovation and creativity in everyday life, Wallace & Gromit\'s World of Invention also highlights the important link between invention and protection for intellectual property. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,37,37,'und',0,'\n					(Published 9 Nov 2012)   On 10 May 2012 we announced that the Australian Government has approved, within the context of its 2012 Budget, changes to fees charged for IP Australia\'s products and services.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,38,38,'und',0,'\n					(Published 7 Nov 2012)   A report on the role intellectual property (IP) plays in public and private collaborations has recommended important initiatives to help drive business innovation.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,39,39,'und',0,'\n					(Published 31 Oct 2012)   The European Patent Office (EPO) is calling for submissions on its proposals to improve and strengthen the Patent Cooperation Treaty (PCT) system. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,40,40,'und',0,'\n					(Published 30 Oct 2012)   eServices now lets you apply for all your IP rights online and from the one convenient location.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,41,41,'und',0,'\n					(Published 24 Oct 2012)   Final call to register for the Melbourne IP Forum\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,42,42,'und',0,'\n					(Published 15 Oct 2012)   The Australian Government is taking practical steps to ensure that the patent system is delivering effective outcomes for consumers and industry with the appointment of an expert panel to review pharmaceutical patents. The Panel will seek public comment before submitting a final report to Government in April 2013.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,43,43,'und',0,'\n					(Published 11 Oct 2012)   All interested stakeholders and members of the public are invited to comment on the draft regulations that provide the important detail of reforms to the Intellectual Property Laws Amendment (Raising the Bar) Act 2012. The draft regulations will be of particular interest to the legal profession, inventors, brand owners and the broader innovation community:\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,44,44,'und',0,'\n					(Published 27 Sep 2012)   Revised release date for the delivery of new eServices and B2B applications due to finalising development and testing.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,45,45,'und',0,'\n					(Published 26 Sep 2012)   Your IP is an important asset of your business. A strong business plan should include strategies to make the most of your IP.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,46,46,'und',0,'\n					(Published 24 Sep 2012)   The Government is considering stronger standards for innovation patents in order to discourage misuse of the IP system. \n				',NULL,'plain_text'),('node',