blication Scheme (IPS) requirements.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,127,127,'und',0,'\n					(Published 28 Apr 2011)   Since 2009, newly notified signs have been published online by the World Intellectual Property Organization (WIPO) every six months at the end of March and September. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,128,128,'und',0,'\n					(Published 28 Apr 2011)   IP Australia has implemented changes to the format of the Designs Certificate of Registration and Certificate of Examination to improve the quality of the products.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,129,129,'und',0,'\n					(Published 21 Apr 2011)   We have commenced the roll out of a new corporate identity and brand architecture. Throughout 2011 our new brand strategy will be applied to all customer touch points - from printed material through to the website.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,130,130,'und',0,'\n					(Published 25 Mar 2011)   In February, we changed our practice with regard to the Case Management of Divisional Patent Applications.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,131,131,'und',0,'\n					(Published 23 Mar 2011)   Developing countries experiencing epidemics and other health crises will now be able to buy vital medicines from Australia at a more affordable price.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,132,132,'und',0,'\n					(Published 21 Mar 2011)   Bringing new ideas to the market place will be quicker following the launch of a work sharing tool that will speed up the processing of patent applications.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,133,133,'und',0,'\n					(Published 21 Mar 2011)   Thanks to an exciting new partnership between IP Australia and the Australian Bankers Association (ABA), Small Business Advisers employed by the major banks will soon have a new IP Fact Sheet to give their clients.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,134,134,'und',0,'\n					(Published 2 Mar 2011)   Advisor Finder is a new tool from business.gov.au designed to help small businesses find their nearest government-funded business advisor.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,135,135,'und',0,'\n					(Published 24 Feb 2011)   The impact of a number of strategies has helped us to significantly reduce the average examination time for patents from an average of 16 months in 2009 to 11 months.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,136,136,'und',0,'\n					(Published 18 Feb 2011)   Prime Minister Julia Gillard and New Zealand Prime Minister John Key, have announced a new initiative to integrate New Zealand and Australia\'s patent examination services. This will result in a single patent examination process for both countries.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,137,137,'und',0,'\n					(Published 16 Feb 2011)   The Advisory Council on Intellectual Property has released its review of patentable subject matter.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,138,138,'und',0,'\n					(Published 27 Jan 2011)   IP Australia has recently completed a review of all the Patents forms used by our customers.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,139,139,'und',0,'\n					(Published 27 Jan 2011)   We have launched our first Privacy Policy. The Privacy Policy explains how we handle the personal information of our customers and others in accordance with the requirements of the Privacy Act 1988.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,140,140,'und',0,'\n					(Published 18 Jan 2011)   IP Australia and the United States Patent and Trademark Office (USPTO) commenced a Patent Prosecution Highway (PPH) pilot on 14 April 2008. IP Australia and the USPTO have now agreed to the extension of the PPH pilot program until 13 April 2012.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,141,141,'und',0,'\n					(Published 15 Dec 2010)   Peter Willimott, Director of Marketing and Customer Engagement at IP Australia recently met with the founder of Makin Trax, Darren Stewart on air to discuss the topic of trade marks during a segment on Kochie\'s Business Builders TV show.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,142,142,'und',0,'\n					(Published 9 Dec 2010)   There has been some media and public interest in the patent application filed by Mary Kay Inc, application number 2007205838, relating to a skin care composition including the ingredient Kakadu Plum extract.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,143,143,'und',0,'\n					(Published 7 Dec 2010)   In accordance with the directives adopted by the PCT Assembly at its thirty-second session, new equivalent amounts in AUD have been established by WIPO. The new PCT fees will become effective from 1 January 2011.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,144,144,'und',0,'\n					(Published 1 Dec 2010)   Customers can now benefit from the latest AusPat enhancement, Australian patent specification text searching, bringing IP Australia one step closer to providing an electronic \'one stop shop\' for all Australian patent information.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,145,145,'und',0,'\n					(Published 16 Nov 2010)   As stated in the Australian Minister for Trade\'s media release, Australia\'s creative industries and iconic brands will soon have greater protection against counterfeiting and piracy following international agreement on a new global standard for intellectual property enforcement.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,146,146,'und',0,'\n					(Published 11 Nov 2010)   Launched today by the Innovation Minister, Senator Kim Carr, the Dream Shield project provides important and practical IP information for Indigenous inventors, designers and business owners.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,147,147,'und',0,'\n					(Published 26 Oct 2010)   Following our notification on 1 September 2010, customers are reminded that the Freedom of Information Amendment (Reform) Act 2010 passed through Parliament 13 May 2010 takes effect from 1 November 2010.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,148,148,'und',0,'\n					(Published 22 Oct 2010)   At a ceremony in Vatican City on the 17th of October 2010, the Roman Catholic Church recognised the first Australian saint.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,149,149,'und',0,'\n					(Published 14 Sep 2010)   The Australian Federal Police (AFP) has today executed 21 warrants across Australia in relation to the organised selling and distribution of counterfeit and pirated goods including trade marked items.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,150,150,'und',0,'\n					(Published 1 Sep 2010)   The Freedom of Information Amendment (Reform) Act 2010 was passed through Parliament on 13 May 2010. The reform aims to promote openness in government by allowing access to information for public viewing. The introduction of this reform has brought about changes to the Freedom of Information in relation to the fees and charges incurred.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,151,151,'und',0,'\n					(Published 12 Aug 2010)   AusPat is IP Australia\'s online search database, currently hosting Australian patent data dating back to 1920. AusPat was released in 2008 and included the ability to develop customised search results, allowing users to view a wide range of discrete data elements for each patent application.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,152,152,'und',0,'\n					(Published 13 Jul 2010)   Small businesses now have a new tool to help them manage their patents, trade marks and other valuable intellectual property (IP) assets.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,153,153,'und',0,'\n					(Published 9 Jul 2010)   Following a review of its fee structure and consultation with customers, IP Australia made a formal request to Government to increase patent fees. This request has been approved and IP Australia will therefore increase some patent fees and introduce two new fee items as of 1 August 2010.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,154,154,'und',0,'\n					(Published 8 Jul 2010)   Generic top level domains (gTLDs) are the last part of a domain name, such as \".com\" or \".net\". There are currently 21 gTLDs in use around the world.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,155,155,'und',0,'\n					(Published 23 Jun 2010)   The community review phase of the inaugural Peer-to-Patent Australia pilot project has now ended.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,156,156,'und',0,'\n					(Published 22 Jun 2010)   IP Australia has recently completed a review of its fee structure.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,157,157,'und',0,'\n					(Published 15 Jun 2010)   In accordance with the directives adopted by the PCT Assembly at its thirty-second session , new equivalent amounts in AUD have been established by WIPO, and the new PCT fees will become effective from 1 July 2010. The changes to the Fees are as follows:\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,158,158,'und',0,'\n					(Published 8 Jun 2010)   The validity of any patent granted by IP Australia may be challenged via court proceedings by any party at any time. The patent (686004), subject to court action taken by Cancer Voices Australia was first granted in Australia in 1998. IP Australia will be monitoring the relevant court proceedings.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,159,159,'und',0,'\n					(Published 21 May 2010)   Due to the 10 year timeframe between renewal periods the Renewal Reminder Notice will now be issued on two separate occasions. This notice will now be issued at four months and again at two months prior to the Renewal Due Date, if payment for renewal has not been received.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,160,160,'und',0,'\n					(Published 18 May 2010)   A forthcoming forum will feature a discussion on how IP Australia has used Web 2.0 technology to enable the community to pool their knowledge and potentially improve patent decision making.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,161,161,'und',0,'\n					(Published 13 May 2010)   IP Australia has completed a review of fees charged under the IP Rights legislation. We have also reviewed our agency Cost Recovery Impact Statement (CRIS). IP Australia is seeking your feedback on the proposed fee changes and the draft CRIS.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,162,162,'und',0,'\n					(Published 11 May 2010)   As a formal component of IP Australia\'s Customer Engagement Strategy, the Business and Industry Forum (BIF), provides the agency with an opportunity to meet with key business stakeholder groups. The objective of the BIF is to gather vital stakeholder feedback in order to improve the way IP Australia administers the registered IP system.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,163,163,'und',0,'\n					(Published 31 Mar 2010)   On 29 March 2010, the New York district court ruled that certain patents relating to breast and ovarian cancer genes BRCA1 and 2 are invalid.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,164,164,'und',0,'\n					(Published 19 Mar 2010)   The Plant Breeder\'s Right Advisory Committee (PBRAC). PBRAC advises the Minister for Innovation, Industry, Science and Research on issues that may arise under the PBR Act. PBRAC also advises the Registrar of Plant Breeder\'s Rights on technical and administrative matters.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,165,165,'und',0,'\n					(Published 4 Mar 2010)   Part 2 of the Australian Designs Office Examination Manual has undergone a review.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,166,166,'und',0,'\n					(Published 2 Mar 2010)   IP Australia\'s new state based lodgement services (IP Lodgement Point) commence in Brisbane Tuesday 6 April 2010. From this date, customers in Brisbane wishing to lodge in person can do so at the CBD based Australia Post GPO which is located at 261 Queen Street.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,167,167,'und',0,'\n					(Published 25 Feb 2010)   Over recent years there have been repeated calls from patent owners in Australia, particularly individuals and small to medium sized enterprises, concerning the difficulties associated with enforcing their patent rights.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,168,168,'und',0,'\n					(Published 9 Feb 2010)   If you are a designer, inventor, innovator, business owner or just about anyone who has an idea, then IP Australia want to speak to you.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,169,169,'und',0,'\n					(Published 9 Feb 2010)   Australia\'s first Peer-to-Patent pilot project is approaching its half-way point.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,170,170,'und',0,'\n					(Published 8 Feb 2010)   In January, the Department of Innovation, Industry, Science and Research launched Commercialisation Australia, a new initiative to assist researchers, entrepreneurs and innovative companies to convert ideas into successful commercial ventures.\n				',NULL,'plain_text');
/*!40000 ALTER TABLE `tbfield_data_body` ENABLE KEYS */;
UNLOCK TABLES;

