INSERT INTO `tbfield_revision_body` VALUES ('node','group',0,1,1,'und',0,'Manual Intellectual Property law group.','','filtered_html'),('node','manual_intellectual_property',0,2,2,'und',0,'\n					(Published 13 Feb 2013)   For decades medical scientists have been trying to understand exactly how insulin works with cells. Insulin\'s structure was discovered in 1969, but how it binds to cells has remained a mystery till now. The process has been likened to a secret handshake which signals for the cells to take sugar from the blood.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,3,3,'und',0,'\n					(Published 2 Jan 2013)   Australia\'s intellectual property (IP) system has had its biggest overhaul in twenty years. The Intellectual Property Laws Amendment (Raising the Bar) Act comes into full effect on 15 April 2013. With changes to patents, trade marks, copyright, designs and plant breeder\'s rights, how will the reforms impact you. Here\'s a short checklist of the big ticket items.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,4,4,'und',0,'\n					(Published 6 Dec 2012)   Australia\'s oldest medical research institute has much to celebrate. The Walter and Eliza Hall Institute is currently involved in more than 60 clinical trials worldwide and has more than 300 projects in the pipeline for tech transfer. The institute files a new patent every few weeks.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,5,5,'und',0,'\n					(Published 5 Nov 2012)   If you want to trade overseas or sell to foreign customers via the internet you should consider seeking trade mark protection in the countries you plan to trade. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,6,6,'und',0,'\n					(Published 28 Sep 2012)   We are committed to involving you in our public consultations. These public consultations are targeted to anyone who is interested as well as experts, peak bodies and interest groups. \n\nWe currently have three main consultations open for comment.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,7,7,'und',0,'\n					(Published 17 Sep 2012)   Of all the intellectual property (IP) rights, it\'s patents that usually grab the headlines and it\'s not hard to see why. A patent is a right granted for any device, substance, method or process which is new, inventive and useful.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,8,8,'und',0,'\n					(Published 17 Aug 2012)   On the 17th August 1945 Indonesia proclaimed it\'s independence.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,9,9,'und',0,'\n					(Published 8 Aug 2012)   A mini biotech boom in Australia fueled by patents.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,10,10,'und',0,'\n					(Published 20 Jul 2012)   Most of us have been attracted to the convenience of a piece of furniture—say a table—that comes flat-packed for self assembly. At some point, usually hours later, we find ourselves staring at indecipherable instructions, holding mysterious leftover pieces and with an end result that looks very different to the picture on the label.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,11,11,'und',0,'\n					(Published 28 Jun 2012)   Ever had anything stolen? Did your car disappear when you ducked into the shops or did you come home from a nice evening out only to find your possessions rifled through, damaged and missing? No doubt you called the police and your insurer, filled in lots of forms and haven’t felt as secure since.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,12,12,'und',0,'\n					(Published 23 May 2012)   The word ‘patent’ comes from the Latin patere, meaning ‘to open’. Its original use was in the term ‘letters patent’ meaning a public reading that authorised an action or exclusive right to a person, usually by royal decree.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,13,13,'und',0,'\n					(Published 24 Apr 2012)   Then believe it or not, you like plant breeder’s rights (PBR).\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,14,14,'und',0,'\n					(Published 17 Feb 2012)   “But I don’t want anyone else to use it!” \n\nAsk any of IP Australia’s trade mark examiners and they will tell you that one of the most common reasons they hear from applicants trying to register their trade mark is that they simply don’t want anyone else to use it.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,15,15,'und',0,'\n					(Published 10 Jan 2012)   Plant Breeder’s Rights (PBR). Never heard of them? They don’t exactly pop up in conversation but don’t let the lack of attention fool you into thinking they’re unimportant.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,16,16,'und',0,'\n					(Published 22 Dec 2011)   Intellectual property (IP) is quietly transforming the world we live in, and major sporting events are no exception. In fact, the Rolex Sydney to Hobart Yacht Race is bursting with different forms of IP like patents, designs and trade marks. The entrants list alone is a roll call of brands like Bacardi, Deloitte, Dodo, Ella Bache, and Hugo Boss.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,17,17,'und',0,'\n					(Published 1 Dec 2011)   If you\'re like most people, you probably associate \'design\' with fashion, and you wouldn\'t be wrong. Consider Louis Vuitton\'s iconic monogram pattern or Mambo\'s cartoon branding - they are distinctive and recognisable the world round and when you see them you know instantly who the companies behind them are.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,18,18,'und',0,'\n					(Published 8 Sep 2011)   Whether you\'re starting a new business, buying an established one or considering expansion options like franchising, it\'s easy to neglect your trade mark in your preparations.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,19,19,'und',0,'\n					(Published 21 Mar 2013)   Plant breeder’s rights rarely make the headlines, but this story grows on you. Canberra has reached the ripe old age of 100 and organisers have gone out on a limb with an official commemorative plant variety. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,20,20,'und',0,'\n					(Published 6 Mar 2013)   A Memorandum of Understanding between the Australian and Chinese Intellectual Property Offices will forge a closer relationship between the two offices on patent matters.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,21,21,'und',0,'\n					(Published 27 Feb 2013)   We are coming into the final stages of the Intellectual Property Legislation Amendment (Raising the Bar) Regulation 2013 implementing the Intellectual Property Laws Amendment (Raising the Bar) Act 2012.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,22,22,'und',0,'\n					(Published 25 Feb 2013)   Singapore recently concluded negotiations with the European Union (EU) on a free trade agreement (the EU-Singapore FTA; or EUSFTA). \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,23,23,'und',0,'\n					(Published 22 Feb 2013)   April 15, 2013 is fast approaching and there are many changes as a result of the Intellectual Property Laws Amendment (Raising the Bar) Act that will affect the way you do business with us. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,24,24,'und',0,'\n					(Published 15 Feb 2013)   The \"Tegernsee Group\" of patent offices is conducting a survey on international harmonisation of patent law. As a stakeholder, the Group wants to hear from you.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,25,25,'und',0,'\n					(Published 11 Feb 2013)   We are counting down to 15 April 2013 when the Intellectual Property Laws Amendment (Raising the Bar) Act comes in to full effect. This is a comprehensive change process. Our commitment is to keep you up-to-date with the changes that will affect the way you do business with us.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,26,26,'und',0,'\n					(Published 8 Feb 2013)   Four new appointments announced by Industry and Innovation Minister Greg Combet will provide further rigour and strategic advice to the Australian Government’s decisions on intellectual property (IP).\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,27,27,'und',0,'\n					(Published 8 Feb 2013)   The Pharmaceutical Patents Review Panel is holding public hearings in Canberra, Sydney and Melbourne between 11-15 February 2013.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,28,28,'und',0,'\n					(Published 30 Jan 2013)   Have you recently been affected by a natural disaster? IP Australia extends our support to you.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,29,29,'und',0,'\n					(Published 18 Jan 2013)   Updates on Single Economic Market Patent Outcomes - Single Application Process & Single Examiner Model\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,30,30,'und',0,'\n					(Published 18 Jan 2013)   An extensive consultation process to strengthen innovation and improve the effectiveness of Australia’s intellectual property (IP) system is nearing completion.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,31,31,'und',0,'\n					(Published 3 Jan 2013)   \nThe Phillipines acceded to the Madrid Protocol on 25 July 2012 as advised in WIPO Information Notice No 9/2012.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,32,32,'und',0,'\n					(Published 11 Dec 2012)   IP Australia\'s Customer Service Centre will be closed from 5pm AEST on Monday, 24 December 2012.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,33,33,'und',0,'\n					(Published 6 Dec 2012)   We have been working on a project to make our website fully adaptive for mobile devices.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,34,34,'und',0,'\n					(Published 20 Nov 2012)   The Pharmaceutical Patents Review Panel has released an issues paper, inviting the public to make submissions by 21 January 2013.  The Review Panel will submit a final report to Government in April 2013.  \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,35,35,'und',0,'\n					(Published 14 Nov 2012)   A new study into the economics of gene patents will address a critical information gap and assist the Australian Government with its development of an evidence-based policy.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,36,36,'und',0,'\n					(Published 13 Nov 2012)   Let Wallace & Gromit welcome you to a world of quirky inventions with their popular exhibition opening at the Powerhouse Museum in Sydney on 15 December 2012. \n\nSponsored by IP Australia and showcasing innovation and creativity in everyday life, Wallace & Gromit\'s World of Invention also highlights the important link between invention and protection for intellectual property. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,37,37,'und',0,'\n					(Published 9 Nov 2012)   On 10 May 2012 we announced that the Australian Government has approved, within the context of its 2012 Budget, changes to fees charged for IP Australia\'s products and services.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,38,38,'und',0,'\n					(Published 7 Nov 2012)   A report on the role intellectual property (IP) plays in public and private collaborations has recommended important initiatives to help drive business innovation.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,39,39,'und',0,'\n					(Published 31 Oct 2012)   The European Patent Office (EPO) is calling for submissions on its proposals to improve and strengthen the Patent Cooperation Treaty (PCT) system. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,40,40,'und',0,'\n					(Published 30 Oct 2012)   eServices now lets you apply for all your IP rights online and from the one convenient location.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,41,41,'und',0,'\n					(Published 24 Oct 2012)   Final call to register for the Melbourne IP Forum\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,42,42,'und',0,'\n					(Published 15 Oct 2012)   The Australian Government is taking practical steps to ensure that the patent system is delivering effective outcomes for consumers and industry with the appointment of an expert panel to review pharmaceutical patents. The Panel will seek public comment before submitting a final report to Government in April 2013.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,43,43,'und',0,'\n					(Published 11 Oct 2012)   All interested stakeholders and members of the public are invited to comment on the draft regulations that provide the important detail of reforms to the Intellectual Property Laws Amendment (Raising the Bar) Act 2012. The draft regulations will be of particular interest to the legal profession, inventors, brand owners and the broader innovation community:\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,44,44,'und',0,'\n					(Published 27 Sep 2012)   Revised release date for the delivery of new eServices and B2B applications due to finalising development and testing.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,45,45,'und',0,'\n					(Published 26 Sep 2012)   Your IP is an important asset of your business. A strong business plan should include strategies to make the most of your IP.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,46,46,'und',0,'\n					(Published 24 Sep 2012)   The Government is considering stronger standards for innovation patents in order to discourage misuse of the IP system. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,47,47,'und',0,'\n					(Published 21 Sep 2012)   The public is invited to comment on draft regulations that provide the important detail of reforms under the Intellectual Property Laws Amendment (Raising the Bar) Act 2012. The Act was passed by Parliament in March this year.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,48,48,'und',0,'\n					(Published 17 Sep 2012)   Changes to supported physical media for PCT-EASY filings and electronic submissions of nucleotide and/or amino acid sequence listings.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,49,49,'und',0,'\n					(Published 11 Sep 2012)   We have been advised by Australia Post that the Queen Victoria Building Post Shop in Sydney is to be refurbished by the end of November 2012.  \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,50,50,'und',0,'\n					(Published 31 Aug 2012)   On 10 May 2012 we announced that the Australian Government has approved, within the context of its 2012 Budget, changes to fees charged for IP Australia\'s products and services.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,51,51,'und',0,'\n					(Published 17 Aug 2012)   You are invited to comment on the exposure draft of the Intellectual Property Laws Amendment Bill 2012. Submissions are due by 1 October 2012.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,52,52,'und',0,'\n					(Published 15 Aug 2012)   From 17 to 19 April this year the High Court heard challenges by several tobacco companies to the validity of the Tobacco Plain Packaging Act 2011.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,53,53,'und',0,'\n					(Published 25 Jul 2012)   The Australian Government has asked the Productivity Commission to undertake a review into compulsory licensing under the Patents Act.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,54,54,'und',0,'\n					(Published 26 Jun 2012)   The World Intellectual Property Organization (WIPO) has recently developed a suite of online tools to help brand owners manage their international trade marks.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,55,55,'und',0,'\n					(Published 19 Jun 2012)   A generic Top-Level Domain (gTLD) is an internet domain name extension such as .com or .net. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,56,56,'und',0,'\n					(Published 7 Jun 2012)   IP Australia will begin internally implementing a new document generation tool later this month to improve the way the organisation produces customer correspondence. The improved system will allow for multiple formats, information sharing and re-use of valuable data into the future.  \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,57,57,'und',0,'\n					(Published 22 May 2012)   Intellectual property is big news in global business but in the small business sphere there are many who would benefit from a better understanding of the concept.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,58,58,'und',0,'\n					(Published 17 May 2012)   Wallace and Gromit, the world-famous characters developed by British studio Aardman Animation, are the stars of an interactive exhibition on innovation and intellectual property (IP) which opened at Scienceworks in Melbourne on 19 May. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,59,59,'und',0,'\n					(Published 11 May 2012)   Expressions of interest are invited from persons who wish to be considered to serve for the Plant Breeder\'s Rights Advisory Committee (PBRAC).\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,60,60,'und',0,'\n					(Published 10 May 2012)   Further to the news article on 9 December 2011, the Australian Government has now approved within the context of its 2012 Budget changes to fees charged for IP Australia\'s products and services. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,61,61,'und',0,'\n					(Published 4 May 2012)   Renewing IP rights and paying for the registration of trade marks has never been easier.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,62,62,'und',0,'\n					(Published 17 Apr 2012)   The Intellectual Property Laws Amendment (Raising the Bar) Act 2012 has passed into law with the Governor General’s assent on Sunday 15 April 2012.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,63,63,'und',0,'\n					(Published 17 Apr 2012)   BioSA has announced a new $1 million fund for intellectual property (IP) protection in South Australia’s universities, Adelaide Research Innovation (ARI), ITEK and Flinders Partners. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,64,64,'und',0,'\n					(Published 16 Apr 2012)   If you are looking at exporting to a few countries you can certainly consider filing your trade mark application in countries of interest yourself, but you need to be mindful that doing it yourself increases the risk of making a mistake and either not achieving registration or gaining a weak or inappropriate registration.  \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,65,65,'und',0,'\n					(Published 16 Apr 2012)   AusIndustry launched their new website on 30 March 2012 to help Australian businesses find the latest information about the grants and assistance programs they deliver. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,66,66,'und',0,'\n					(Published 4 Apr 2012)   Our Online Services will be down over the Easter long weekend due to system maintenance.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,67,67,'und',0,'\n					(Published 3 Apr 2012)   CSIRO’s recent $220 million litigation settlement in the United States to licence the wireless local area network (Wi-Fi) invention would not have been possible without patent protection.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,68,68,'und',0,'\n					(Published 20 Mar 2012)   The Intellectual Property Laws Amendment (Raising the Bar) Bill 2012 was passed by the House of Representatives on 20 March 2012. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,69,69,'und',0,'\n					(Published 7 Mar 2012)   WIPO\'s World Intellectual Property Indicators 2011 report provides a wide range of indicators covering various areas of IP.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,70,70,'und',0,'\n					(Published 6 Mar 2012)   The Canberra office of IP Australia will be closed for the Canberra Day Holiday from 5pm on Friday, 9 March until 9am on Tuesday, 13 March.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,71,71,'und',0,'\n					(Published 1 Mar 2012)   The World Intellectual Property Organization (WIPO) is tackling environmental challenges head-on, by developing practical tools that will help the adaptation, adoption and use of \"green\" technology particularly in the developing world.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,72,72,'und',0,'\n					(Published 28 Feb 2012)   The Intellectual Property Laws Amendment (Raising the Bar) Bill 2011 was passed by the Senate on the 27th of February 2012.  All parties endorsed the Bill and as a result no amendments were moved.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,73,73,'und',0,'\n					(Published 25 Feb 2012)   Have you ever thought about being the next Albert Einstein or Thomas Jefferson?\nThen why not consider a challenging and rewarding career as a Patent Examiner with IP Australia?\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,74,74,'und',0,'\n					(Published 14 Feb 2012)   Lovers across the country are in the middle of the annual Valentine\'s Day rush on our rose stocks - long stemmed, pink, white red and yellow and all colours in between, you name it, someone wants it.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,75,75,'und',0,'\n					(Published 10 Feb 2012)   Kenkoku Kinen No Hi (National Foundation Day) is celebrated on the 11th of February each year in Japan. Early Japanese history books suggest that on this day in the year 660 BC, the first Japanese emperor, Emperor Jimmu, was crowned. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,76,76,'und',0,'\n					(Published 6 Feb 2012)   IP Australia is hosting two major international meetings of working groups dedicated to streamlining the operations of the global intellectual property system.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,77,77,'und',0,'\n					(Published 23 Jan 2012)   The 23rd of January marked the start of the Chinese Year of the Dragon. Traditionally, the Dragon is one of the luckiest signs in the Chinese Zodiac, so perhaps 2012 is the right time to consider exporting to China. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,78,78,'und',0,'\n					(Published 19 Jan 2012)   Apply online by 29 February 2012\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,79,79,'und',0,'\n					(Published 18 Jan 2012)   The Australian Government is calling for applications from consortia seeking to establish a Cooperative Research Centre (CRC).\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,80,80,'und',0,'\n					(Published 19 Dec 2011)   IP Australia’s Customer Service Centre will be closed from 5pm AEST on Friday, 23 December 2011.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,81,81,'und',0,'\n					(Published 12 Dec 2011)   New enhancements to AusPat, IP Australia\'s online Patent search database, look to expand IP Australia\'s eDossier service, enabling customers to be notified of changes in Patent case files. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,82,82,'und',0,'\n					(Published 12 Dec 2011)   We have simplified access to the current offerings of online services. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,83,83,'und',0,'\n					(Published 9 Dec 2011)   IP Australia Fee Review 2011 Consultation Paper is now available for public consultation\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,84,84,'und',0,'\n					(Published 29 Nov 2011)   In the early days of Lonely Planet, founder Tony Wheeler quickly learnt the importance of building a brand and protecting his valuable intellectual property (IP) overseas. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,85,85,'und',0,'\n					(Published 23 Nov 2011)   Providing patent protection for innovators and researchers whilst ensuring reasonable access to the new technologies and medical treatments they develop are the key objectives of the Government\'s response to three important reports into Australia\'s patent system and gene patents.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,86,86,'und',0,'\n					(Published 16 Nov 2011)   What would you ask the head of the World Intellectual Property Organization if you had five minutes in his company?\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,87,87,'und',0,'\n					(Published 11 Nov 2011)   At the 11th hour of the 11th day of the 11th month, Australia and many other countries in the Commonwealth stop what they are doing, whether it\'s study or work, for a minute of silence to remember and reflect on the sacrifices made by thousands of people in wars and armed conflicts. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,88,88,'und',0,'\n					(Published 10 Nov 2011)   Are you looking for a challenging and rewarding career as a patent examiner with IP Australia?\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,89,89,'und',0,'\n					(Published 1 Nov 2011)   It\'s the race that stops the nation, but how do the great racing houses stop their IP galloping down the straight into someone else\'s hands?\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,90,90,'und',0,'\n					(Published 28 Oct 2011)   WIPO has advised of a temporary disruption to some of their services. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,91,91,'und',0,'\n					(Published 25 Oct 2011)   The Australian Marketing Institute honoured IP Australia\'s Dream Shield with the national award for corporate social responsibility in Sydney recently.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,92,92,'und',0,'\n					(Published 13 Oct 2011)   IP Australia would like to congratulate the winners of this year\'s Prime Minister\'s Prize for Science, Professors Ezio Rizzardo and David Solomon from the CSIRO and the University of Melbourne.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,93,93,'und',0,'\n					(Published 30 Sep 2011)   Calling all small business owners - do you want to increase your confidence, build sales and gather new ideas?  Then this event is for you. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,94,94,'und',0,'\n					(Published 29 Sep 2011)   To ensure customers are paying an appropriate amount for services, IP Australia periodically undertakes a Fee Review. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,95,95,'und',0,'\n					(Published 29 Sep 2011)   New PCT fee charges will take effect from 1 November 2011.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,96,96,'und',0,'\n					(Published 26 Sep 2011)   On 16 September 2011, US President Barack Obama signed into law the America Invents Act (AIA).  \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,97,97,'und',0,'\n					(Published 26 Sep 2011)   It\'s now easier than ever to access information about intellectual property (IP). \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,98,98,'und',0,'\n					(Published 22 Sep 2011)   The Australia Marketing Institute honoured IP Australia\'s Dream Shield with the Corporate Social Responsibility Award in Canberra on 15 September.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,99,99,'und',0,'\n					(Published 9 Sep 2011)   IP Australia has undertaken a complete review of its web presence and is pleased to announce the launch of our new website.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,100,100,'und',0,'\n					(Published 31 Aug 2011)   With all the international doom and gloom lately, it\'s nice to hear some promising local news. Trade mark applications are up - to pre GFC levels in fact. Last financial year saw trade mark applications from Australian businesses in a record 69,003 classes. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,101,101,'und',0,'\n					(Published 24 Aug 2011)   The Advisory Council on Intellectual Property (ACIP) is now inviting submissions on the innovation patent system from interested parties.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,102,102,'und',0,'\n					(Published 18 Aug 2011)   Edward Evans wins the grand final of the ABC New Inventors program for 2011 with his invention The Swing Gate.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,103,103,'und',0,'\n					(Published 4 Aug 2011)   IP Australia is introducing a new look for Plant Breeder\'s Rights Examination Reports commencing 15 August 2011.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,104,104,'und',0,'\n					(Published 29 Jul 2011)   Generic top level domains (gTLDs) are the last part of a domain name, such as \".com\" or \".net\". Currently there are 22 gTLDs that can be used worldwide. The Internet Corporation for Assigned Names and Numbers (ICANN) has developed a new process to allow any organisation to introduce its own gTLD.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,105,105,'und',0,'\n					(Published 28 Jul 2011)   The Intellectual Property Research Institute of Australia (IPRIA) in association with the Institute for Patent and Trade Mark Attorneys of Australia (IPTA) are proud to present this free seminar - Why Do Firms Patent?\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,106,106,'und',0,'\n					(Published 15 Jul 2011)   The creative minds of tertiary students have been put on display this month, with the winning entries of the Hard Sell video competition uploaded onto IP Australia\'s YouTube channel.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,107,107,'und',0,'\n					(Published 14 Jul 2011)   Business owners can now avoid the costly mistake of registering a business name that has already been trade marked, thanks to a new tool - TM Check.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,108,108,'und',0,'\n					(Published 5 Jul 2011)   Inventors in Australia and New Zealand can look forward to a faster, cheaper and more streamlined trans-Tasman patent process, as announced today by Australia\'s Innovation Minister, Senator Kim Carr, and the New Zealand Commerce Minister, Simon Power.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,109,109,'und',0,'\n					(Published 1 Jul 2011)   From 1 July 2011, users of the Australian Trade Marks Online Search System (ATMOSS) will notice extra information available in relation to International Registrations (IRs).\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,110,110,'und',0,'\n					(Published 22 Jun 2011)   IP Australia has engaged the creative minds of students to put together a short video commercial highlighting the importance of IP for Australian businesses. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,111,111,'und',0,'\n					(Published 22 Jun 2011)   Senator Kim Carr, the Minister for Innovation, Industry, Science and Research has introduced the Intellectual Property Laws Amendment (Raising the Bar) Bill 2011 in the Senate.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,112,112,'und',0,'\n					(Published 21 Jun 2011)   From 15 July 2011, IP Australia and the United States Patent and Trademark Office (USPTO) will be joining a pilot of an expanded Patent Prosecution Highway (PPH) arrangement. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,113,113,'und',0,'\n					(Published 20 Jun 2011)   IP Australia has recently completed a review of all the trade mark forms used by our customers.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,114,114,'und',0,'\n					(Published 14 Jun 2011)   IP Australia is pleased to introduce a new look for the Designs Examination Reports. Our customers will begin to receive the new reports from 15 June 2011.  \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,115,115,'und',0,'\n					(Published 6 Jun 2011)   Trade Minister Craig Emerson meets with India\'s Minister for Commerce and Industry to launch Free Trade Agreement negotiations.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,116,116,'und',0,'\n					(Published 3 Jun 2011)   The Government has issued responses for two reviews completed by the Advisory Council on Intellectual Property.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,117,117,'und',0,'\n					(Published 2 Jun 2011)   IP Australia has teamed up with the Institute of Chartered Accountants to produce the fourth installment of their Business Briefing Series: 20 Issues on Intellectual Property. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,118,118,'und',0,'\n					(Published 1 Jun 2011)   Tony Wheeler talks about the importance of IP protection and the strategic use of IP to help build a global brand.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,119,119,'und',0,'\n					(Published 31 May 2011)   IP Australia has recently completed a review of all the Design forms used by our customers.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,120,120,'und',0,'\n					(Published 31 May 2011)   On 7 April 2011, IP Australia and the New Zealand Ministry of Economic Development released a discussion paper for a trans-Tasman patent attorney regulatory framework.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,121,121,'und',0,'\n					(Published 30 May 2011)   Innovation Minister Senator Carr yesterday announced the launch of the new eDossier tool on the AusPat patent database, giving innovators free access to a wide range of patent documents.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,122,122,'und',0,'\n					(Published 23 May 2011)   Patent records dating back to 1904 can now be accessed online thanks to the latest updates to AusPat - the Australian patent database.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,123,123,'und',0,'\n					(Published 20 May 2011)   On 12 May 2011, the Federal Executive Council made the Intellectual Property Legislation Amendment Regulations 2011 (No. 1) which will have effect from 1 July 2011.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,124,124,'und',0,'\n					(Published 19 May 2011)   AusPat now provides full text searching of Australian patent records dating back to 1904.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,125,125,'und',0,'\n					(Published 16 May 2011)   If you are ready to start exporting or have recently launched your new website it is time to think about how you are going to protect your intellectual property (IP) overseas.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,126,126,'und',0,'\n					(Published 12 May 2011)   The Freedom of Information Amendment (Reform) Act 2010 introduced changes on 1 November 2010 to the FOI fees which could be charged by government agencies. As part of the FOI reform, from 1 May 2011 agencies must publish a range of information to comply with the Information Publication Scheme (IPS) requirements.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,127,127,'und',0,'\n					(Published 28 Apr 2011)   Since 2009, newly notified signs have been published online by the World Intellectual Property Organization (WIPO) every six months at the end of March and September. \n				',NULL,'plain_text'),('node','manual_intellectual_property',0,128,128,'und',0,'\n					(Published 28 Apr 2011)   IP Australia has implemented changes to the format of the Designs Certificate of Registration and Certificate of Examination to improve the quality of the products.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,129,129,'und',0,'\n					(Published 21 Apr 2011)   We have commenced the roll out of a new corporate identity and brand architecture. Throughout 2011 our new brand strategy will be applied to all customer touch points - from printed material through to the website.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,130,130,'und',0,'\n					(Published 25 Mar 2011)   In February, we changed our practice with regard to the Case Management of Divisional Patent Applications.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,131,131,'und',0,'\n					(Published 23 Mar 2011)   Developing countries experiencing epidemics and other health crises will now be able to buy vital medicines from Australia at a more affordable price.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,132,132,'und',0,'\n					(Published 21 Mar 2011)   Bringing new ideas to the market place will be quicker following the launch of a work sharing tool that will speed up the processing of patent applications.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,133,133,'und',0,'\n					(Published 21 Mar 2011)   Thanks to an exciting new partnership between IP Australia and the Australian Bankers Association (ABA), Small Business Advisers employed by the major banks will soon have a new IP Fact Sheet to give their clients.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,134,134,'und',0,'\n					(Published 2 Mar 2011)   Advisor Finder is a new tool from business.gov.au designed to help small businesses find their nearest government-funded business advisor.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,135,135,'und',0,'\n					(Published 24 Feb 2011)   The impact of a number of strategies has helped us to significantly reduce the average examination time for patents from an average of 16 months in 2009 to 11 months.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,136,136,'und',0,'\n					(Published 18 Feb 2011)   Prime Minister Julia Gillard and New Zealand Prime Minister John Key, have announced a new initiative to integrate New Zealand and Australia\'s patent examination services. This will result in a single patent examination process for both countries.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,137,137,'und',0,'\n					(Published 16 Feb 2011)   The Advisory Council on Intellectual Property has released its review of patentable subject matter.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,138,138,'und',0,'\n					(Published 27 Jan 2011)   IP Australia has recently completed a review of all the Patents forms used by our customers.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,139,139,'und',0,'\n					(Published 27 Jan 2011)   We have launched our first Privacy Policy. The Privacy Policy explains how we handle the personal information of our customers and others in accordance with the requirements of the Privacy Act 1988.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,140,140,'und',0,'\n					(Published 18 Jan 2011)   IP Australia and the United States Patent and Trademark Office (USPTO) commenced a Patent Prosecution Highway (PPH) pilot on 14 April 2008. IP Australia and the USPTO have now agreed to the extension of the PPH pilot program until 13 April 2012.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,141,141,'und',0,'\n					(Published 15 Dec 2010)   Peter Willimott, Director of Marketing and Customer Engagement at IP Australia recently met with the founder of Makin Trax, Darren Stewart on air to discuss the topic of trade marks during a segment on Kochie\'s Business Builders TV show.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,142,142,'und',0,'\n					(Published 9 Dec 2010)   There has been some media and public interest in the patent application filed by Mary Kay Inc, application number 2007205838, relating to a skin care composition including the ingredient Kakadu Plum extract.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,143,143,'und',0,'\n					(Published 7 Dec 2010)   In accordance with the directives adopted by the PCT Assembly at its thirty-second session, new equivalent amounts in AUD have been established by WIPO. The new PCT fees will become effective from 1 January 2011.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,144,144,'und',0,'\n					(Published 1 Dec 2010)   Customers can now benefit from the latest AusPat enhancement, Australian patent specification text searching, bringing IP Australia one step closer to providing an electronic \'one stop shop\' for all Australian patent information.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,145,145,'und',0,'\n					(Published 16 Nov 2010)   As stated in the Australian Minister for Trade\'s media release, Australia\'s creative industries and iconic brands will soon have greater protection against counterfeiting and piracy following international agreement on a new global standard for intellectual property enforcement.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,146,146,'und',0,'\n					(Published 11 Nov 2010)   Launched today by the Innovation Minister, Senator Kim Carr, the Dream Shield project provides important and practical IP information for Indigenous inventors, designers and business owners.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,147,147,'und',0,'\n					(Published 26 Oct 2010)   Following our notification on 1 September 2010, customers are reminded that the Freedom of Information Amendment (Reform) Act 2010 passed through Parliament 13 May 2010 takes effect from 1 November 2010.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,148,148,'und',0,'\n					(Published 22 Oct 2010)   At a ceremony in Vatican City on the 17th of October 2010, the Roman Catholic Church recognised the first Australian saint.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,149,149,'und',0,'\n					(Published 14 Sep 2010)   The Australian Federal Police (AFP) has today executed 21 warrants across Australia in relation to the organised selling and distribution of counterfeit and pirated goods including trade marked items.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,150,150,'und',0,'\n					(Published 1 Sep 2010)   The Freedom of Information Amendment (Reform) Act 2010 was passed through Parliament on 13 May 2010. The reform aims to promote openness in government by allowing access to information for public viewing. The introduction of this reform has brought about changes to the Freedom of Information in relation to the fees and charges incurred.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,151,151,'und',0,'\n					(Published 12 Aug 2010)   AusPat is IP Australia\'s online search database, currently hosting Australian patent data dating back to 1920. AusPat was released in 2008 and included the ability to develop customised search results, allowing users to view a wide range of discrete data elements for each patent application.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,152,152,'und',0,'\n					(Published 13 Jul 2010)   Small businesses now have a new tool to help them manage their patents, trade marks and other valuable intellectual property (IP) assets.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,153,153,'und',0,'\n					(Published 9 Jul 2010)   Following a review of its fee structure and consultation with customers, IP Australia made a formal request to Government to increase patent fees. This request has been approved and IP Australia will therefore increase some patent fees and introduce two new fee items as of 1 August 2010.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,154,154,'und',0,'\n					(Published 8 Jul 2010)   Generic top level domains (gTLDs) are the last part of a domain name, such as \".com\" or \".net\". There are currently 21 gTLDs in use around the world.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,155,155,'und',0,'\n					(Published 23 Jun 2010)   The community review phase of the inaugural Peer-to-Patent Australia pilot project has now ended.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,156,156,'und',0,'\n					(Published 22 Jun 2010)   IP Australia has recently completed a review of its fee structure.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,157,157,'und',0,'\n					(Published 15 Jun 2010)   In accordance with the directives adopted by the PCT Assembly at its thirty-second session , new equivalent amounts in AUD have been established by WIPO, and the new PCT fees will become effective from 1 July 2010. The changes to the Fees are as follows:\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,158,158,'und',0,'\n					(Published 8 Jun 2010)   The validity of any patent granted by IP Australia may be challenged via court proceedings by any party at any time. The patent (686004), subject to court action taken by Cancer Voices Australia was first granted in Australia in 1998. IP Australia will be monitoring the relevant court proceedings.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,159,159,'und',0,'\n					(Published 21 May 2010)   Due to the 10 year timeframe between renewal periods the Renewal Reminder Notice will now be issued on two separate occasions. This notice will now be issued at four months and again at two months prior to the Renewal Due Date, if payment for renewal has not been received.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,160,160,'und',0,'\n					(Published 18 May 2010)   A forthcoming forum will feature a discussion on how IP Australia has used Web 2.0 technology to enable the community to pool their knowledge and potentially improve patent decision making.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,161,161,'und',0,'\n					(Published 13 May 2010)   IP Australia has completed a review of fees charged under the IP Rights legislation. We have also reviewed our agency Cost Recovery Impact Statement (CRIS). IP Australia is seeking your feedback on the proposed fee changes and the draft CRIS.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,162,162,'und',0,'\n					(Published 11 May 2010)   As a formal component of IP Australia\'s Customer Engagement Strategy, the Business and Industry Forum (BIF), provides the agency with an opportunity to meet with key business stakeholder groups. The objective of the BIF is to gather vital stakeholder feedback in order to improve the way IP Australia administers the registered IP system.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,163,163,'und',0,'\n					(Published 31 Mar 2010)   On 29 March 2010, the New York district court ruled that certain patents relating to breast and ovarian cancer genes BRCA1 and 2 are invalid.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,164,164,'und',0,'\n					(Published 19 Mar 2010)   The Plant Breeder\'s Right Advisory Committee (PBRAC). PBRAC advises the Minister for Innovation, Industry, Science and Research on issues that may arise under the PBR Act. PBRAC also advises the Registrar of Plant Breeder\'s Rights on technical and administrative matters.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,165,165,'und',0,'\n					(Published 4 Mar 2010)   Part 2 of the Australian Designs Office Examination Manual has undergone a review.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,166,166,'und',0,'\n					(Published 2 Mar 2010)   IP Australia\'s new state based lodgement services (IP Lodgement Point) commence in Brisbane Tuesday 6 April 2010. From this date, customers in Brisbane wishing to lodge in person can do so at the CBD based Australia Post GPO which is located at 261 Queen Street.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,167,167,'und',0,'\n					(Published 25 Feb 2010)   Over recent years there have been repeated calls from patent owners in Australia, particularly individuals and small to medium sized enterprises, concerning the difficulties associated with enforcing their patent rights.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,168,168,'und',0,'\n					(Published 9 Feb 2010)   If you are a designer, inventor, innovator, business owner or just about anyone who has an idea, then IP Australia want to speak to you.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,169,169,'und',0,'\n					(Published 9 Feb 2010)   Australia\'s first Peer-to-Patent pilot project is approaching its half-way point.\n				',NULL,'plain_text'),('node','manual_intellectual_property',0,170,170,'und',0,'\n					(Published 8 Feb 2010)   In January, the Department of Innovation, Industry, Science and Research launched Commercialisation Australia, a new initiative to assist researchers, entrepreneurs and innovative companies to convert ideas into successful commercial ventures.\n				',NULL,'plain_text');
