INSERT INTO `tbsearch_dataset` VALUES (1,'node',' manual intellectual property request group membership manual intellectual property law group  ',0),(2,'node',' insulin breakthrough could improve the lives of millions of diabetics  published 13 feb 2013 for decades medical scientists have been trying to understand exactly how insulin works with cells insulin s structure was discovered in 1969 but how it binds to cells has remained a mystery till now the process has been likened to a secret handshake which signals for the cells to take sugar from the blood  ',0),(3,'node',' ip reform what you need to know  published 2 jan 2013 australia s intellectual property ip system has had its biggest overhaul in twenty years the intellectual property laws amendment raising the bar act comes into full effect on 15 april 2013 with changes to patents trade marks copyright designs and plant breeder s rights how will the reforms impact you here s a short checklist of the big ticket items  ',0),(4,'node','  185 million research facility promotes collaboration  published 6 dec 2012 australia s oldest medical research institute has much to celebrate the walter and eliza hall institute is currently involved in more than 60 clinical trials worldwide and has more than 300 projects in the pipeline for tech transfer the institute files a new patent every few weeks  ',0),(5,'node',' calculating international trade marks  published 5 nov 2012 if you want to trade overseas or sell to foreign customers via the internet you should consider seeking trade mark protection in the countries you plan to trade  ',0),(6,'node',' improving our intellectual property system  published 28 sep 2012 we are committed to involving you in our public consultations these public consultations are targeted to anyone who is interested as well as experts peak bodies and interest groups we currently have three main consultations open for comment  ',0),(7,'node',' powerful patents  published 17 sep 2012 of all the intel